import Link from 'next/link';
import Responsive from '../components/Responsive';
const Index = () => (
  <Responsive>
    <div>
      <Link href='/'>
        <a>Main Page</a>
      </Link>
      <Link href='/about'>
        <a>About Page</a>
      </Link>
      <p>Main Page</p>
    </div>
  </Responsive>
);

export default Index;
